ur calendar.'=>'Permite a los usuarios crear y vender tiques para eventos que envíen a tu calendario.','Enable 3rd party event submissions.'=>'Permite el envío de eventos de terceros.','Allow users to search for events by category, tag, venue, organizer, day of the week, time of day, and price.'=>'Permite a los usuarios buscar eventos por categoría, etiqueta, local, organizador, día de la semana, hora del día y precio.','Email marketing to promote your events'=>'Marketing por correo electrónico para promocionar tus eventos','Collect RSVPs and sell tickets'=>'Recoge RSVPS y vende tiques','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Importa eventos desde Meetup, Eventbrite, iCal, Google Calendar y más.','The #1 calendar for WordPress'=>'El calendario nº1 para WordPress','There are a few %s to resolve and prevent 404 errors.'=>'Hay unos cuantos %s que resolver y evitar errores 404.','I keep getting “Page Not Found” on events.'=>'Sigo teniendo «Página no encontrada» en los eventos.','%s and other common installation issues.'=>'%s y otros problemas habituales de la instalación.','I installed the calendar and it crashed my site.'=>'He instalado el calendario y se ha roto mi sitio.','This can happen when other plugins try to improve performance. %s.'=>'Esto puede ocurrir cuando otros plugins tratan de mejorar el rendimiento. %s.','My calendar doesn’t look right.'=>'Mi calendario no se ve bien.','Here’s an overview of %s and what they mean.'=>'Aquí está un resumen del %s y de lo que significa.','Common Error Messages'=>'Mensajes de error comunes','Check for updates'=>'Buscar actualizaciones','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be comprimised if your site is running outdated or mis-matched versions.'=>'Es importante usar las versiones más recientes de nuestros plugins para que tengas acceso a las últimas características, correcciones a fallos y actualizaciones de seguridad. La funcionalidad del plugin puede verse comprometida si tu sitio está ejecutando versiones obsoletas o que no sean las adecuadas.','Plugin(s) are out of date'=>'Hay plugins sin actualizar','Enter a custom API key'=>'Introduce una clave API personalizada','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'The Events Calendar trae una clave API para la funcionalidad básica de mapas. Si quieres usar características más avanzadas, como pins personalizados en los mapas, carga dinámica de mapas o búsqueda de ubicación de Events Calendar Pro y la vista avanzada de mapas, tendrás que obtener tu propia clave API de Google Maps y añadirla a Eventos > Ajustes > Integraciones','Default Google Maps API key'=>'Clave API por defecto de Google Maps','Manage your licenses'=>'Gestiona tus licencias','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Las claves de licencia solo pueden usarse en un número limitado de sitios, lo que varía dependiendo de tu nivel de licencia. Tienes que eliminar la licencia de uno o más sitios para poder usar esta.','Install max has been reached'=>'Máximo de instalaciones alcanzado','Adjust your timezone'=>'Ajusta tu zona horaria','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Al usar The Events Calendar recomendamos encarecidamenteque uses una zona horaria geográfica, como «España/Madrid» y evites usar una zona horaria con desfase UTC como «UTC+1». Elegir una zona horaria UTC para tu sitio o para eventos individuales puede provocar problemas al importar eventos o con el horario de verano. Ve a tus ajustes generales de WordPress para ajustar la zona horaria de tu sitio.','Site time zone uses UTC'=>'La zona horaria del sitio utiliza UTC','This extension allows you to add custom HTML content to the top of the Community Events submission form.'=>'Esta extensión te permite añadir contenido HTML personalizado a la parte superior del formulario de envío de eventos de la comunidad.','Display Custom HTML'=>'Mostrar HTML personalizado','This extension allows you to hide the Organizers and Venues that a visitor has not created from the Community Events submission form.'=>'Esta extensión te permite ocultar los organizadores y locales que un visitante no haya creado desde el formulario de envío de eventos de la comunidad.','Hide Others’ Organizers and Venues'=>'Ocultar los organizadores y locales de otros','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Esta extensión añade las casillas de verificación de «Mostrar Google Maps» y «Mostrar enlace a Google Maps» al crear un nuevo local.','Add Google Maps Display and Link Options'=>'Opciones de añadir la visualización y enlace a Google Maps','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Esta extensión te permite configurar los símbolos de moneda por defecto para que los elijan tus usuarios en vez de tener un campo de texto plano.','Add Cost Currency Symbol'=>'Añadir símbolo de moneda del precio','This extension will send an email to event organizers whenever a user registers for their event.'=>'Esta extensión enviará un correo electrónico a los organizadores de eventos cuando un usuario se registre en su evento.','Organizer Notification Email'=>'Correo electrónico de aviso al organizador','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Muestra también la información recogida por los «campos meta de asistentes» en las pantallas del pedido de WooCommerce.','Add Event & Attendee Info to WooCommerce Order Details'=>'Añadir información del evento y asistentes a los detalles del pedido de WooCommerce','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Esta extensión muestra una caja meta con una clave API en cada evento con tiques/registro.','Per Event Check In API'=>'Comprobación en cada evento de la API','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Añade un nuevo panel de ajustes en Eventos > Ajustes que ofrece más control sobre los correos electrónicos de tiques y registros enviados a los asistentes tras el registro.','Ticket Email Settings'=>'Ajustes de correo electrónico del tique','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Cuando provienen de tiques pagados, estos pedidos pueden reembolsarse desde la plataforma de comercio electrónico en uso.','How do I process refunds for tickets?'=>'¿Cómo proceso reembolsos para los tiques?','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'¡Sí! Puedes fácilmente cumplir esta tarea usando las opciones de inventario y múltiples tipos de tiques disponibles en Event Tickets.','Can I have a seating chart associated with my tickets?'=>'¿Puedo tener un plano de asientos asociado a mis tiques?','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Puedes vender tiques usando nuestra opción de comercio electrónico incluida, o actualizar a Event Tickets Plus para usar plugins de comercio electrónico como WooCommerce.','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'¿Cómo configuro plugins de comercio electrónico para vender tiques?','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'Hemos preparado un tutorial en vídeo que muestra cómo crear eventos con tiques utilizando nuestros plugins. Haz clic en el enlace del título para saber más.','Calendar'=>'Calendario','Activate'=>'Activar','How Do I create events with Tickets or RSVP’s?'=>'¿Cómo creo eventos con tiques o RSVPs?','This extension is a collection of tweaks and snippets for The Events Calendar.'=>'Esta extensión es una colección de retoques y fragmentos de código para The Events Calendar','The Events Calendar Tweaks'=>'Retoques de The Events Calendar','This extension replaces photo view with a tiled grid of cards featuring event images.'=>'Esta extensión reemplaza la visualización de la foto con una cuadrícula apilada de tarjetas destacando imágenes el evento.','Alternative photo view'=>'Visualización alternativa de la foto','This extension adds a set of block patterns for events to the WordPress block editor.'=>'Esta extensión añade un conjunto de patrones de bloques de eventos al editor de bloques de WordPress.','Event block patterns'=>'Patrones de bloques de eventos','This extension creates a useful variety of WordPress widget areas (a.k.a. sidebars).'=>'Esta extensión crea una útil variedad de áreas de widgets de WordPress (también conocidas como barras laterales).','Calendar widget areas'=>'Áreas de widgets de calendario','Our plugins include many shortcodes that do everything from embedding the calendar...'=>'Nuestros plugins incluyen muchos shortcodes que hacen todo lo necesario desde incrustar el calendario…','Where can I find a list of available shortcodes?'=>'¿Dónde puedo encontrar una lista de los shortcodes disponibles?','Use our free Event Tickets plugin to get started with tickets and RSVPs.'=>'Usa nuestro plugin gratuito Event Tickets para dar los primeros pasos con tiques y RSVPs.','How do I sell tickets to events?'=>'¿Cómo vendo tiques de los eventos?','Events Calendar Pro runs alongside The Events Calendar and enhances...'=>'Events Calendar Pro se ejecuta junto a The Events Calendar y mejora...','What do I get with Events Calendar Pro?'=>'¿Qué consigo con Events Calendar Pro?','No, but you can use event categories or tags to display certain events like having...'=>'No, pero puedes usar categorías o etiquetas de eventos para mostrar ciertos eventos que tengan…','Can I have more than one calendar?'=>'¿Puedo tener más de un calendario?','* Your system information will only be used by The Events Calendar support team. All information is stored securely. We do not share this information with any third parties.'=>'* La información de tu sistema solamente será utilizada por el equipo de soporte de The Events Calendar. Toda la información se almacena de forma segura. No compartimos esta información con ningún tercero.','Yes, automatically share my system information with The Events Calendar support team*'=>'Sí, comparto automáticamente la información de mi sistema con el equipo de soporte de The Events Calendar *','Please opt-in below to automatically share your system information with our support team. This will allow us to assist you faster if you post in our help desk.'=>'Por favor, acepta abajo para compartir automáticamente la información de tu sistema con nuestro equipo de soporte. Esto nos permitirá ayudarte más rápido si publicas en nuestro centro de ayuda.','Open a ticket'=>'Abre un tique','Included with our premium products'=>'Incluido en nuestros productos premium','Get support from humans'=>'Consigue soporte de humanos','Recent template changes'=>'Cambios recientes en la p